//var $jQ = jQuery.noConflict();
$(document).ready(function (e) {
    e("html").removeClass("no-js").addClass("js");
    e("a.protected").wbEmailProtect();
    if (e().wbGallery && e("#home-feature").length) {
        e("#home-feature aside").wbGallery()
    }
    if (e().wbDrawerToggle && e("#menu-top").length) {
        e("#menu-top li.parent").wbDrawerToggle()
    }
    if (e().wbMenuActivator && e("#menu-top").length) {
        e("#menu-top li a").wbMenuActivator()
    }
    if (e().wbCatalogSlider && e("#shop-in-shop").length && e("#products-container").length) {
        e("#products-container").wbCatalogSlider({
            otherContent: "#shop-in-shop"
        });
        e("#shop-in-shop").wbCatalogSlider({
            otherContent: "#products-container"
        })
    } else if (e().wbCatalogSlider && e("#products-container").length) {
        var t = e("#products-container").find("article");
        t.wbCatalogSlider()
    }
    /*
    if (e().wbSimpleSwitcher && e("#product-media img").length > 1) {
        e("#product-media").wbSimpleSwitcher()
    }
    if (e().wbSimpleSwitcher && e("#product-info dl.switcher").length) {
        e("#product-info dl.switcher").wbSimpleSwitcher({
            orderAttribute: "data-size",
            switcherElement: "dt",
            contentElement: "dd",
            contentClass: "chart-content",
            bigTarget: false,
            clickNotHover: true
        })
    }*/
    if (e().wbRemoveItem && e("#mini-cart").length) {
        e("#mini-cart").wbRemoveItem()
    }
    if (e().wbPictureZoom && e("#product-overview img").length) {
        e("#product-overview img").wbPictureZoom({
            cloneToContainer: e("#matter"),
            selectorToHide: e("#side-nav, #product-media"),
            maxWidth: 512,
            maxHeight: 636
        })
    }
    if (e().wbTabMenu && e(".content-nav").length) {
        e(".content-nav li").wbTabMenu()
    }
    if (e().wbInnerInput && e("#product-action div.product-qty").length) {
        e("#product-action div.product-qty").wbInnerInput()
    }
    if (e().tooltip) {
        e("a, input, img, button, li, span").tooltip({
            track: true,
            delay: 400,
            showURL: false,
            showBody: " - ",
            fade: 100
        });
        e(".is-blog img").tooltip({
            track: true,
            delay: 99999999,
            showURL: false,
            showBody: " - ",
            fade: 100
        })
    }
    if (e().wbLinkGroup && e(".link-group").length) {
        e(".link-group").wbLinkGroup()
    }
    if (e('a[rel="external"]').length) {
        e('a[rel="external"]').click(function () {
            window.open(e(this).attr("href"));
            return false
        })
    }
});